--
-- Bytecode Disassembler
--

BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "global" (
	"name"	TEXT NOT NULL,
	"value"	BLOB NOT NULL,
	PRIMARY KEY("name")
);
CREATE TABLE IF NOT EXISTS "file_data" (
	"id"	INTEGER,
	"data"	BLOB NOT NULL,
	"hash"	BLOB NOT NULL,
	"size"	INTEGER NOT NULL,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "file_contents" (
	"id"	INTEGER,
	"size"	BIGINT NOT NULL,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "file_section" (
	"contents"	INTEGER NOT NULL,
	"offset"	BIGINT NOT NULL,
	"data"	INTEGER NOT NULL,
	FOREIGN KEY("contents") REFERENCES "file_contents"("id"),
	FOREIGN KEY("data") REFERENCES "file_data"("id")
);
CREATE TABLE IF NOT EXISTS "undo" (
	"id"	INTEGER,
	"link"	INTEGER,
	"data"	BLOB NOT NULL,
	FOREIGN KEY("link") REFERENCES "undo"("id"),
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "snapshot" (
	"id"	INTEGER,
	"name"	TEXT NOT NULL,
	"parent"	INTEGER,
	"data"	BLOB NOT NULL,
	"contents"	INTEGER NOT NULL,
	"auto"	BOOLEAN,
	"undo"	INTEGER,
	"redo"	INTEGER,
	FOREIGN KEY("undo") REFERENCES "undo"("id"),
	FOREIGN KEY("contents") REFERENCES "file_contents"("id"),
	FOREIGN KEY("redo") REFERENCES "undo"("id"),
	FOREIGN KEY("parent") REFERENCES "snapshot"("id"),
	PRIMARY KEY("id")
);
